window.bookSummaryJSON = "<p>In a world where vampires have conquered mankind, Turner West is the only thing they fear.&nbsp;</p> <p>Threaded with silver through his body, he is a Bonemaker - a rare human who can Unmake vampires with a single cut of his blade. Crossing the prairie of what was once the United States, Turner will face a blood-crazed cult, a governor who wants power more than life itself, and a trio of beautiful women who will help him toward his ultimate goal: ridding the world of bloodsuckers.&nbsp;</p> <p>There's just one problem. Turner's exploits have attracted a vampire so old, his very existence threatens what remains of the human race. Extinction is upon us.</p>"; 
